import {NavLink} from "react-router-dom"


const Nav=()=>{
    return(
        <div>
            <h1 class="ui header">Student</h1>
            <div class="ui two item menu">
                    
            	        <NavLink activeClassName="item" to="/">Home</NavLink>
                        <NavLink activeClassName="item" to="/add">Add Student</NavLink>

               
                    </div>
	        
    
        </div>
    )
}
export default Nav
